import React from 'react';
//import '../css/App.css';
import { BrowserRouter, Outlet, Route, Routes } from 'react-router-dom';

import MainPage from './MainPage';
import ParentForm from './ParentForm'; // ParentForm을 import 합니다.
import Test from './Test';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<MainPage />}>
            {/* ParentForm을 렌더링하는 라우트를 추가합니다. */}
            <Route path="/register" element={<ParentForm formType="register" />} />
            <Route path="/login" element={<ParentForm formType="login" />} />
          </Route>
          <Route path="/test" element={<Test />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
